    help: '<html>\n <head>\n  <style>@import url("https://fonts.googleapis.com/css2?family=Ubuntu&display=swap");\n\n    body {\n      font-family: "Ubuntu", sans-serif;\n    }\n\n    img {\n      display: block;\n      margin-left: auto;\n      margin-right: auto;\n      max-width: 100%;\n      object-fit: contain;\n    }</style>\n </head>\n <body>\n  <p style="text-align: justify;"><i>Como complicación del tratamiento se puede presentar hepatotoxicidad</i></p>\n  <p style="text-align: justify;"><i>Recordar que el<b> tratamiento antifúngico sistemático (VO)</b> está indicado en:</i></p>\n  <ul>\n   <li style="text-align: justify;"><i>Tiña capitis</i></li>\n   <li style="text-align: justify;"><i>Tiña ungis</i></li>\n   <li style="text-align: justify;"><i>Falla en el tratamiento tópico</i></li>\n   <li style="text-align: justify;"><i>Pacientes con inmunosupresión&nbsp;</i></li>\n   <li style="text-align: justify;"><i>Lesión muy dispersa&nbsp;</i></li>\n  </ul>\n  <p style="text-align: justify;"><i><b>Fármacos utilizados en tto sistémico: </b>Terbianfina, Itraconazol, Fluconazol, Griseofulvinaa</i></p>\n </body>\n</html>',
