    help: '<html>\n <head>\n  <style>@import url("https://fonts.googleapis.com/css2?family=Ubuntu&display=swap");\n\n    body {\n      font-family: "Ubuntu", sans-serif;\n    }\n\n    img {\n      display: block;\n      margin-left: auto;\n      margin-right: auto;\n      max-width: 100%;\n      object-fit: contain;\n    }</style>\n </head>\n <body>\n  <div>\n   <i>Las tiñas afectan principalmente el estrato córnea pero pueden llegar a afectar hasta la capa espinozz como en el caso de la tiña capitis.</i>\n  </div>\n  <div>\n   <i style="font-size: 1rem;"><br></i>\n  </div>\n  <div>\n   <i style="font-size: 1rem;">Capas afectadas:</i>\n  </div>\n  <ul>\n   <li><i>Tiña corporis: Capa córnea</i></li>\n   <li><i>Tiña capitis: Capa córnea, granulosa y espinoza</i></li>\n   <li><i>Tiña pedis: Capa córnea</i></li>\n   <li><i>Tiña inguis: Capa córnea</i></li>\n  </ul>\n </body>\n</html>',
